SET client_encoding = 'UTF8';
SET standard_conforming_strings = off;
SET check_function_bodies = false;
SET client_min_messages = warning;
SET escape_string_warning = off;

CREATE OR REPLACE FUNCTION ouinfo_insertdefaultdata(vm ouinfo)
  RETURNS integer AS
$BODY$
declare
	vm_id integer;
BEGIN
	select id into vm_id from ouinfo where mac_prefix=vm.mac_prefix;
	
	if vm_id IS NULL THEN
		insert into ouinfo(
			mac_prefix, vendor)
			values( 
			vm.mac_prefix, vm.vendor
			);
			return lastval();
	end if;
	return -1;
EXCEPTION
	WHEN OTHERS THEN 
		RETURN -2;	
END;

  $BODY$
  LANGUAGE 'plpgsql' VOLATILE
  COST 100;
